package Practice;

public class New_swap_numbers_with_variable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 3;
		int b = 4;
		int temp;
		temp = b;
		b = a;
		a = temp;
		System.out.println("a="+a);
		System.out.println("b="+b);
		

		
	}

}
